function extractClassHistoram() {
    var classHistogram = {}
    // moduleHistogram = {}

    Properties.values(this.targetJSO.registry).each(function(ea) {
        var c = ea["__LivelyClassName__"]
        if (!classHistogram[c]) { classHistogram[c] = 0 };
        classHistogram[c]++
    })

    this.get('Analysis').textString = Properties.own(classHistogram)
        .sortBy(function(ea) { return Number(classHistogram[ea])})
        .reverse()
        .collect(function(ea) {[ea]
            return ea + ": " + classHistogram[ea]
        }).join("\n")
    return classHistogram
}

